function Main() {
    return (
        <main>
      <section className="profile">
        <div className="profile__info">
          <button className="profile__button"
          onClick={handleEditAvatarClick}>
            <img
              className="profile__avatar"
              src="https://www.rgo.ru/sites/default/files/styles/head_image_article/public/1034295-e1477344635669-1.jpg?itok=4U4Dw9en"
              alt="Фото профиля"
            />
          </button>
          <h1 className="profile__title"></h1>
          <button
            className="profile__edit-button button-hover"
            type="button"
            onClick={handleEditProfileClick}
          ></button>
          <p className="profile__subtitle"></p>
        </div>
        <button className="profile__add-button" type="button"
        onClick={handleEditPlaceClick} ></button>
      </section>
      <section className="elements">
        <template id="card">
          <article className="card">
            <button className="card__delete button-hover" type="button"></button>
            <img
              className="card__image"
              src="https://pictures.s3.yandex.net/frontend-developer/cards-compressed/baikal.jpg"
              alt="Фото посещенного места"
            />
            <div className="card__name">
              <h2 className="card__title"></h2>
              <div className="card__likes">
                <button className="card__like" type="button"></button>
                <h4 className="card__count-likes"></h4>
              </div>
            </div>
          </article>
        </template>
      </section>
    </main>
    );
}
export default Main;

function handleEditAvatarClick() {
  document.querySelector(".update-avatar").classList.add("popup_opened");
};
function handleEditProfileClick() {
  document.querySelector(".profile-popup").classList.add("popup_opened");
};
function handleAddPlaceClick() {
  document.querySelector(".place-popup").classList.add("popup_opened");
};
